import logo from './logo.svg';
import background from './background.png';
import './App.css';

function sayHello() {
  alert('You clicked me!');
}

function App() {
  return (
    <div class='main-menu'>
      <div class="buttonOne" onClick={sayHello}>START</div>
      <div class="buttonTwo" onClick={sayHello}>INSTRUCTIONS</div>
    </div>



  );
}

export default App;

